- Green if correct, red if false

    <script>
        // Get all the runs and their names
        let paths = document.querySelectorAll('path');
        let runPaths = Array.from(paths).filter(path => path.hasAttribute('inkscape:label'));

        // Set all to invisible
        for (var i = 0; i < runPaths.length; i++) {
                runPaths[i].style.fillOpacity = 0;
                runPaths[i].style.strokeOpacity = 0;
        }

        // Randomly select a run from the run list to display
        function getRandomInt(max) {
            return Math.floor(Math.random() * max);
        }
        let runMax = runPaths.length;
        let runIndex = getRandomInt(runMax);
        let selectedRun = runPaths[runIndex].getAttribute('inkscape:label');

        // Display the run name to find
        let displayName = document.getElementById('run_name');
        displayName.innerHTML = "Please find " + selectedRun;

        // Funtion to turn a run visible on click
        function changeColor(event) {
            let paths = document.querySelectorAll('path');
            let runPaths = Array.from(paths).filter(path => path.hasAttribute('inkscape:label'));
            var isRun = false;

            // Turn any/all visible runs invisible again
            for (var i = 0; i < runPaths.length; i++) {
                // while looping through all runs, check if the thing clicked is a run
                if (event.target == runPaths[i]) {
                    isRun = true;
                    console.log("isRun " + isRun);
                }
                if (runPaths[i].style.fillOpacity > 0 || runPaths[i].style.strokeOpacity > 0) {
                    // if there is a visible element, make it invisible again upon click
                    runPaths[i].style.fillOpacity = 0;
                    runPaths[i].style.strokeOpacity = 0;
                }
            }

            // Once no more visible shapes, change the current shape to visible
            // Still need to check that the thing clicked is in my list of runs (not e.g., run marker)
            if (isRun == true) {
                event.target.style.fillOpacity = 0.3;
                event.target.style.strokeOpacity = 1;
            }
        }

        // On hover, the runs should highlight so they are more visible
        document.addEventListener('mouseover', changeColor);

        // On click, get the name of the run clicked and check it against the value
        function checkName(event, selectedRun) {
            // get the name of the currently selected element
            var displayName = document.getElementById('run_name');
            var hasRun = event.target.hasAttribute('inkscape:label');
            var run = event.target.getAttribute('inkscape:label'); // target inkscape name

            if (hasRun && run != "") {
                if (run == selectedRun) {
                    // if correct, reload for anther guess
                    location.reload();
                    console.log("CORRECT");
                } else {
                    // un-highlight incorrect guess
                    // event.target.style.fillOpacity = 0;
                    // event.target.style.strokeOpacity = 0;
                    console.log("WRONG");
                }
            }
        }
        document.addEventListener('click', function(event) {
            checkName(event, selectedRun);
        });
        // document.addEventListener('click', checkName);

    </script>
